import React, { useEffect } from "react";
import CommonTable from "../components/common/CommonTable";
import AddCategoryDialog from "../components/forms/addCategory";
import { Category_Api } from "../api/category_api";

const HeaderValue = ["Category", "Status"];

const Category = () => {
  const [modalOpen, setmodalOpen] = React.useState(false);
  const [data, setData] = React.useState([]);

  const addCategoty = () => {
    setmodalOpen(!modalOpen);
  };

  const closeModal = () => {
    setmodalOpen(!modalOpen);
  };

  const getData = async () => {
    console.log("res");
    const res = await Category_Api.Get_Category();
    console.log(res);
    if (res.code == 200) {
      setData(res.data.res.data);
    } else {
      return [];
    }
  };

  const submit = async fields => {
    const res = await Category_Api.Add_Category(fields);
  };

  useEffect(() => {
    getData();
  });

  return (
    <React.Fragment>
      <CommonTable
        Header={HeaderValue}
        buttonLabel={"Add Category"}
        onClick={() => addCategoty()}
        data={data}
      />
      {modalOpen && (
        <AddCategoryDialog
          closeModal={closeModal}
          submit={fields => submit(fields)}
        />
      )}
    </React.Fragment>
  );
};

export default Category;
